    parse: function(trait) {
      let commas = /,/g
      let dots   = /\./g
      let spaces = /\s+/g
  
      let qualified = trait.trim()
                         .replace(':','')
                         .replace("'",'')
                         .replace(commas,'')
                         .replace(dots,'')
                         .replace(spaces,'-')
                         .toLowerCase()
                       
      return qualified
    },
    slot: function(qualified) {
      let list = ['backgrounds','bodies','companions','heads','runes','shields','weapons']
      for (var slot of list) {
        if (this[slot][qualified]) {
          return this[slot][qualified]
        }
      }
    },
